import { ErrorMessage, Field, Form, Formik } from 'formik';
import React, { useEffect, useState, useRef } from 'react';
import { Link } from "react-router-dom";
import { getUser } from '../../Utils/Common';
import { useLocation } from 'react-router-dom';
import '../../Utils/Constants';
import ModalGen from '../../Utils/Modals/ModalGeneric';
import GenericApi from '../../Api/Services/GenericApi';
import { useParams } from "react-router";
import Spinner from '../../Utils/Spinner';
import Center from '../../Utils/Styles/Center.js'
import moment from 'moment';

function DatoInteresadoMigracionForm() {

    const [getMaximoTextArea, setMaximoTextArea] = useState(0);
    const [getMinimoTextArea, setMinimoTextArea] = useState(0);
    const [countTextArea, setCountTextArea] = useState(0);
    const [getLista, setLista] = useState({ title: "", message: "", show: false });
    const [getModalState, setModalState] = useState({ title: "", message: "", show: false });
   

    let { radicado, version, id, item } = useParams();

    const [existeInformacion, setExisteInformacion] = useState(false);
    const [primerNombre, setPrimerNombre] = useState('');
    const [segundoNombre, setSegundoNombre] = useState('');
    const [primerApellido, setPrimerApellido] = useState('');
    const [segundoApellido, setSegundoApellido] = useState('');
    const [numeroDocumento, setNumeroDocumento] = useState('');
    const [email, setEmail] = useState('');
    const [telefono, setTelefono] = useState('');
    const [telefono2, setTelefono2] = useState('');
    const [lugarNacimiento, setLugarNacimiento] = useState('');
    const [profesion, setProfesion] = useState('');
    const [idOrientacionSexual, setIdOrientacionSexual] = useState('');
    const [idSexo, setIdSexo] = useState('');
    const [idNacionalidad, setIdNacionalidad] = useState('');
    const [codMunicipio, setCodMunicipio] = useState('');
    const [localidad, setLocalidad] = useState('');
    const [ciudad, setCiudad] = useState('');
    const [barrio, setBarrio] = useState('');
    const [direccion, setDireccion] = useState('');
    const [diligenciadoPor, setDiligenciadoPor] = useState('');
    const [idTipoEntidad, setIdTipoEntidad] = useState('');
    const [nombreEntidad, setNombreEntidad] = useState('');
    const [sectorEntidad, setSectorEntidad] = useState('');
    const [tipoInteresado, setTipoInteresado] = useState('');

    useEffect(() => {
        async function fetchData() {
            window.showSpinner(true);
            lista();
            
        }
        fetchData();
    }, []);

    
    function containsSpecialChars(str) {

        const result = global.Constants.TEXT_AREA.CARACTERES_ESPECIALES.split('').some(specialChar => {
            if (str.includes(specialChar)) {
                return true;
            }

            return false;
        });

        return result;
    }

    const lista= () => {
        try {

            //buscamos el parametro
            GenericApi.getGeneric("migracion-interesado/"+radicado+"/"+version+"/"+id+"/"+item).then(
                datos => {

                    if (!datos.error) {
                        setLista(datos);
                        setExisteInformacion(true);
                        obtenerParametros();
                    } else {
                        setModalState({ title: "Antecedentes", message: datos.error.toString(), show: true, redirect: '/AntecedentesForm', alert: global.Constants.TIPO_ALERTA.ERROR });
                    }
                   
                }
            )
        } catch (error) {
            // console.log(error);
        }
    }

    const obtenerParametros = () => {
        try {

            const data = {
                "data": {
                    "type": 'mas_parametro',
                    "attributes": {
                        "nombre": "minimo_caracteres_textarea|maximo_caracteres_textarea"
                    }
                }
            }

            //buscamos el parametro
            GenericApi.getByDataGeneric("parametro/parametro-nombre",data).then(
                datos => {

                    if (!datos.error) {

                        if (datos["data"].length > 0) {

                            datos["data"].filter(data => data["attributes"]["nombre"].includes('minimo_caracteres_textarea')).map(filteredName => (
                                setMinimoTextArea(filteredName["attributes"]["valor"])
                            ))
                            datos["data"].filter(data => data["attributes"]["nombre"].includes('maximo_caracteres_textarea')).map(filteredName => (
                                setMaximoTextArea(filteredName["attributes"]["valor"])
                            ))

                        }
                    } else {
                        setModalState({ title: "Antecedentes", message: datos.error.toString(), show: true, redirect: '/AntecedentesForm', alert: global.Constants.TIPO_ALERTA.ERROR });
                    }
                    window.showSpinner(false);
                }
            )
        } catch (error) {
            // console.log(error);
        }
    }

    const handleClick = (event, i) => {

        if(i===1){
            setPrimerNombre(getLista.data[0].attributes.primerNombre);
        }

        else if(i===2){
            setSegundoNombre(getLista.data[0].attributes.segundoNombre);      
        }

        else if(i===3){
            setPrimerApellido(getLista.data[0].attributes.primerApellido);
        }

        else if(i===4){
            setSegundoApellido(getLista.data[0].attributes.segundoApellido);      
        }

        else if(i===5){
            setNumeroDocumento(getLista.data[0].attributes.numeroDocumento);      
        }

        else if(i===6){
            setEmail(getLista.data[0].attributes.email);      
        }

    };


    const handleInputChange = (event, i) => {
     
        if(i===1){
            setPrimerNombre(event.currentTarget.value);
        }

        else if(i===2){
            setSegundoNombre(event.currentTarget.value)
        }

        else if(i===3){
            setPrimerApellido(event.currentTarget.value)
        }

        else if(i===4){
            setSegundoApellido(event.currentTarget.value)
        }

        else if(i===5){
            setNumeroDocumento(event.currentTarget.value)
        }

        else if(i===6){
            setEmail(event.currentTarget.value)
        }

        return true;

        //return true;
    }



    const infoInteresado = () => {

        if (getLista.data != null && typeof (getLista.data) != 'undefined') {
            return (

                getLista.data.map((item, i) => {
                    return (
                        <>
                        {/* 1. PRIMER NOMBRE */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="interesado_primer_nombre_origen">Primer nombre</label>
                                <Field value={item.attributes.interesado} as="input" type="text" autoComplete="off" className="form-control" 
                                id="interesado_primer_nombre_origen" name="interesado_primer_nombre_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 1)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="interesado_nombres_destino">Primer nombre<span className="text-danger">*</span></label>
                                <Field value={primerNombre} as="input" type="text" autoComplete="off" className="form-control" 
                                id="interesado_nombres_destino" name="interesado_nombres_destino" onChange={event => handleInputChange(event, 1)}></Field>
                            </div>
                        </div> 

                        {/* APELLIDOS */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="interesado_apellidos_origen">Apellidos</label>
                                <Field value={item.attributes.interesado} as="input" type="text" autoComplete="off" 
                                className="form-control" id="interesado_apellidos_origen" name="interesado_apellidos_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 2)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    

                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="interesado_apellidos_destino">Apellidos<span className="text-danger">*</span></label>
                                <Field value={apellidos} as="input" type="text" autoComplete="off" className="form-control"
                                 id="interesado_apellidos_destino" name="interesado_apellidos_destino" onChange={event => handleInputChange(event, 2)}></Field>
                            </div>
                        </div>


                        {/* TIPO DE IDENTIFICACION */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="interesado_tipo_identificacion_origen">Tipo de identificación</label>
                                <Field value={item.attributes.identificacion_interesado} as="input" type="text" autoComplete="off" 
                                className="form-control" id="interesado_tipo_identificacion_origen" name="interesado_tipo_identificacion_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
                            <div className="form-group">
                                <Center>
                                    <button type="button" className="btn btn-success" onClick={event => handleClick(event, 3)}>
                                        <i class="fas fa-angle-double-right"></i></button>
                                </Center>
                            </div>
                        </div>    
                            
                        <div className="col-md-5">
                           <div className="form-group">
                                <label htmlFor="interesado_tipo_identificacion_destino">Tipo de identificación<span className="text-danger">*</span></label>
                                <Field value={tipoIdentificacion} as="input" type="text" autoComplete="off" className="form-control" 
                                id="interesado_apellidos_destino" name="interesado_tipo_identificacion_destino" 
                                onChange={event => handleInputChange(event, 2)}></Field>
                            </div>
                        </div> 

                        {/* IDENTIFICACION */}   
                        <div className="col-md-5">
                            <div className="form-group">
                                <label htmlFor="interesado_num_identificacion_origen">No. Identificación</label>
                                <Field value={item.attributes.identificacion_interesado} as="input" type="text" autoComplete="off" 
                                className="form-control" 
                                id="interesado_num_identificacion_origen" name="interesado_num_identificacion_origen"></Field>
                            </div>
                        </div>
                        
                        <div className="col-md-2">
